import Header from '../components/Header';


const AccountStyles = styled.div`
  display: grid;
  grid-template-columns: 1fr 3fr 1fr;
  grid-template-rows: 30px 60px 60px 60px auto;
  align-items: center;
  #title {
    grid-column: 2;
    grid-row: 1;
  }
  #link1 {
    grid-column: 2;
    grid-row: 2;
  }
  #link2 {
    grid-column: 2;
    grid-row: 3;
  }
  #button {
    grid-column: 2;
    grid-row: 4;
  }
  #orders {
    grid-column: 2;
    grid-row: 5;
  }
`;
export default function ContactPage() {
  return (
    <div>
      <Header />
      <h1>Contact Us!</h1>
      <p>Ataire, 1557 London Road, Norbury London, SW16 4AD, Tell +442038932944</p>
    </div>
  );
}
